Musza / Budapest/ Hungary

@muzsabar 
The menu is a feast for all senses. Combining three eras - past, present and future - into 15 signature cocktails, they seamlessly blend local history, creative storytelling, and exotic flavours, while the dishes are a wonderful, unique combination of Asian and Hungarian cuisine.
@cocktailbars

The Garden Room / Atlanta / USA

@thegardenroomatlanta 
The Garden Room – an immersive garden bar and dining experience, is an enchanted escape welcoming in its beauty and appealing through its casual approach.
 @cocktailbars

Room 309 / Hong Kong 

@room309hk 
In this one-of-a-kind hotel room, expert resident bartenders whip up
an array of cocktails, making the experience an intimate affair for
no more than 20 guests at a time. Can you imagine that?
@cocktailbars

The Salon / New York / USA
@701west 
The Salon is 701West’s opulent cocktail bar, featuring an inventive cocktail program that spans signature takes on cocktail classics to visionary reserve cocktails that showcase rare ingredients.Awarded three stars by The New York Times.
@cocktailbars

Under / Baly / Norway 

@underlindesnes @nuelverstudio 
At the southernmost point of the Norwegian coastline by the village of Båly, Snøhetta has designed Europe’s very first underwater restaurant. With its immediate proximity with the forces of nature, the restaurant and bar, which will also function as a research center for marine life, is a tribute to the Norwegian coast and to Lindesnes – to the wild fauna of the sea and to the rocky coastline of Norway’s southern tip.
@cocktailbars

Kin Toh / Tulum / Mexico

@kintoh.azulik 
KIN TOH Mayan-Mexican avant-garde restaurant and bar that combines methods and local ingredients from native cuisine with international elements to offer guest an experience where all senses are involved in each dish and cocktail. 
@cocktailbars

#toolsofthetrade 
@tepotztli 

Each Tepotztli piece is individually handcrafted one piece at a time by artisans in Sierra Madre Mountains, communities located high in the Sierra Madres Occidental of Southwestern Mexico. Tepotztli represent the finest art of Mexican copper making, celebrating the Purepecha Empires way of copper making.

Matsuhisa / Athens / Greece

@matsuhisa_athens 
Home of the world famous Nobu cuisine, the restaurant Matsuhisa Athens has put the lean and modest power of Japanese culture and the charm of fusion philosophy on the gastronomic map of Athens. Located in one of the city’s most stylish and scenic locations, in Astir, Matsuhisa Athens promises a truly unforgettable gastronomic experience.
@cocktailbars

Raised by Wolves / San Diego / USA

@raisedbywolvesspirits 
Raised By Wolves is an opulently-decorated cocktail bar in a San Diego mall. Hidden behind a fireplace, it’s offering cocktail lovers a whole new drinking experience. 
@cocktailbars

Mei Ume / London / UK
@meiumelondon 
The Mei Ume Bar is the focal point of the restaurant where the energetic, sociable and talented team of bartenders offer signature Asian-inspired cocktails and a wide selection of sake, shochu and Japanese whiskeys. The interactive bar experience includes a Sushi Bar overseen by Sushi Chef Mun Seok Choi serving a creative selection of sushi, sashimi and small plates.  @cocktailbars

Edgars Flavour’s / Brussels / Belgium

@edgars.flavors 
One of the finest Agave Oriented bar in Europe can be find in Brussels, Own and run by @tania.shamshur who running incredible agave spirit program specializing in independent spirits. Boutique spirits, creative cocktails and great atmosphere a must visit while in Brussels.
